acos:
public Complex acos() {
    if (isNaN) {
        return NaN;
    }

    return this.add(this.sqrt1z().multiply(I)).log().multiply(I.negate());
}

asin:
public Complex asin() {
    if (isNaN) {
        return NaN;
    }

    return sqrt1z().add(this.multiply(I)).log().multiply(I.negate());
}

atan:
public Complex atan() {
    if (isNaN) {
        return NaN;
    }

    return this.add(I).divide(I.subtract(this)).log()
            .multiply(I.divide(createComplex(2.0, 0.0)));
}

